import "./App.css";
import { useState } from "react";

function App() {
  const pages = process.env.REACT_APP_PAGES.split(";");
  const [pos, setPos] = useState(0);
  setTimeout(function () {
    setPos(pos + 1);
  }, 3000);
  return (
    <div className="App">
      <iframe src={pages[pos]} title="description"></iframe>
    </div>
  );
}

export default App;
